import React from "react";
import logo from "../../assets/Got7_2022_logo.png";
import MenuIcon from "../MenuIcon";


function Member_nav() {
  return (
    <>
      <nav className="navbar" style={{display:"flex", justifyContent:"space-between"}}>
        <div className="navbar-logo" style={{display:"flex", marginTop:"20px"}} >
          <div className="pic">
            <img className="logo7" src={logo} alt="Logo" style={navbar_logo} />
          </div>
        </div>
        <div className="">
          <MenuIcon />
        </div>
      </nav>
    </>
  );
}
export default Member_nav;

const navbar_logo = {
    width:"100%",
    height:"60px",
};
